import useFetch from '../../hooks/useFetch'
import './Profile.css'

async function Profile() {
  const users = await fetch('https://127.0.0.1:3000/service/users')
  console.log(users)
  return (
    <aside id="profile">
      Hola, {users.username}
    </aside>
  )
}

export default Profile
